INSERT INTO `c_service_sql` VALUES ('1', 'query.order.orderInfo', '订单信息', 'oId', '1', '{\n                                                 	\"param1\":\"SELECT co.app_id appId,co.create_time createTime,co.ext_transaction_id extTransactionId,co.finish_time finishTime\n                                                 ,co.order_type_cd orderTypeCd,co.o_id oId ,co.remark remark ,co.request_time requestTime ,co.user_id userId,co.status_cd statusCd\n                                                  FROM c_orders co WHERE co.o_id = #oId#\",\n                                                  \"param2\":\"SELECT cb.b_id bId, cb.business_type_cd businessTypeCd,cb.create_time createTime,cb.finish_time finishTime ,cb.o_id oId,\n                                                 cb.remark remark,cb.status_cd statusCd FROM c_business cb WHERE cb.o_id = #oId#\"\n                                                 }', '', null, '{\"PARAM:\"{\n                                                            \"param1\": \"$.#order#Object\",\n                                                            \"param2\": \"$.#business#Array\"\n                                                            },\"TEMPLATE\":\"{\n                                                         \"response\": {\n                                                           \"code\": \"0000\",\n                                                           \"message\": \"成功\"\n                                                         }\n                                                       }\"}', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('2', 'query.menu.info', '查询菜单1', 'userId,domain', '1', '{\"param1\":\"SELECT mm.`m_id` `mId`,mm.name menuName,mm.`g_id` gId,mm.`url`,mm.seq menuSeq,mm.`p_id` pId,\r\n	mm.`description` menuDescription, mmg.name menuGroupName,mmg.`icon`,mmg.`label`,mmg.`seq` menuGroupSeq,\r\n	mmg.`description` menuGroupDescription,mm.is_show isShow,mm.description FROM m_menu mm,m_menu_group mmg\r\n	WHERE mm.`g_id` = mmg.`g_id`\r\n	and mmg.group_type = #groupType#\r\n	and mmg.store_type= #domain#\r\n	AND mm.`m_id` IN (\r\n		SELECT pp.`m_id` FROM p_privilege_user ppu,p_privilege pp\r\n		WHERE ppu.`p_id` = pp.`p_id`\r\n		and pp.domain in (#domain#,\'9999\')\r\n		AND ppu.`privilege_flag` = \'0\'\r\n		AND ppu.`user_id` = #userId#\r\n		AND ppu.`status_cd` = \'0\'\r\n		AND pp.`status_cd` = \'0\'\r\n		UNION\r\n		SELECT pp.`m_id` FROM p_privilege_user ppu,p_privilege_group ppg,p_privilege pp,p_privilege_rel ppr\r\n		WHERE ppu.`p_id` = ppr.pg_id\r\n		AND ppr.pg_id = ppg.pg_id\r\n		AND ppr.p_id = pp.`p_id`\r\n		and pp.domain in (#domain#,\'9999\')\r\n		AND ppu.`privilege_flag` = \'1\'\r\n		AND ppu.`user_id` = #userId#\r\n		AND ppu.`status_cd` = \'0\'\r\n		AND pp.`status_cd` = \'0\'\r\n		AND ppg.status_cd = \'0\'\r\n		AND ppr.status_cd = \'0\'\r\n	)\r\n	AND mm.`status_cd` = \'0\'\r\n	AND mmg.`status_cd` = \'0\'\"}', '', null, '{\"PARAM\":{\n                                                            \"param1\": \"$.#menus#Array\"\n                                                            },\"TEMPLATE\":{\n                                                        \n                                                       }}', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('3', 'query.user.loginInfo', '查询用户登录信息', 'userCode', '1', '{\"param1\":\"select a.user_id userId,a.name userName,a.password userPwd ,a.level_cd levelCd,a.tel \nfrom u_user a where (a.name = #userCode# \nor a.tel = #userCode#)\n<if test=\\\"pwd != null and pwd != \'\'\\\">\nand a.password = #pwd#\n</if>\n<if test=\\\"levelCdTag != null and levelCdTag != \'\'\\\">\nand a.level_cd in(\'00\',\'01\',\'03\',\'04\')\n</if>\nand a.status_cd = \'0\'\nlimit 1\"}', '', null, '{\"PARAM\":{                                                            \"param1\": \"$.#user#Object\"                                                            },\"TEMPLATE\":{                                                         \"response\": {                                                           \"code\": \"0000\",                                                           \"message\": \"成功\"                                                         }                                                       }}', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('4', 'query.console.template', '查询模板信息', 'templateCode', '1', '{\n                                                 	\"param1\":\"SELECT t.template_code templateCode,t.name templateName,t.`html_name` htmlName,t.`url` templateUrl\n                                                              FROM c_template t WHERE t.status_cd = \'0\' AND t.template_code = #templateCode#\"\n                                                 }', '', null, '{\"PARAM\":{\n                                                            \"param1\": \"$.#template#Object\"\n                                                            },\"TEMPLATE\":{\n                                                         \"response\": {\n                                                           \"code\": \"0000\",\n                                                           \"message\": \"成功\"\n                                                         }\n                                                       }}', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('5', 'query.console.templateCol', '查询模板列信息', 'templateCode', '1', '{\n                                                 	\"param1\":\"SELECT t.template_code templateCode,t.name templateName,tc.col_name colName,tc.col_model colModel FROM c_template t,c_template_col tc WHERE t.status_cd = \'0\' AND t.template_code = tc.template_code\n                                                              AND tc.status_cd = \'0\'\n                                                              AND t.template_code = #templateCode#\"\n                                                 }', '', null, '{\"PARAM\":{\n                                                            \"param1\": \"$.#template#Array\"\n                                                            },\"TEMPLATE\":{\n                                                         \"response\": {\n                                                           \"code\": \"0000\",\n                                                           \"message\": \"成功\"\n                                                         }\n                                                       }}', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('6', 'query.center.mapping', '查询映射数据', 'page,rows,sord', '1', '{\"param1\":\"select count(1) records,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) total from c_mapping m where m.status_cd = \'0\'\",\n                                                             \"param2\":\"SELECT m.`id` id,m.`domain` domain,m.name name,m.`key`  `key` ,m.`value` `value`,m.`remark` remark FROM c_mapping m WHERE m.`status_cd` = \'0\' LIMIT #page#, #rows#\"\n                                                             }', '', null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {\n                                                        		\"response\": {\n                                                        			\"code\": \"0000\",\n                                                        			\"message\": \"成功\"\n                                                        		}\n                                                        	}\n                                                        }', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('7', 'query.center.apps', '查询外部应用', 'page,rows,sord', '1', '{\"param1\":\"select count(1) records,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) total from c_app a where a.status_cd = \'0\'\",\n                                                             \"param2\":\"SELECT m.`id` id,m.`app_id` appId,m.name `name`,m.`security_code`  securityCode ,m.`while_list_ip` whileListIp,m.`black_list_ip` blackListIp,m.`remark` remark FROM c_app m WHERE m.`status_cd` = \'0\' LIMIT #page#, #rows#\"\n                                                             }', '', null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {\n                                                        		\"response\": {\n                                                        			\"code\": \"0000\",\n                                                        			\"message\": \"成功\"\n                                                        		}\n                                                        	}\n                                                        }', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('8', 'query.center.services', '查询服务数据', 'page,rows,sord', '1', '{\"param1\":\"select count(1) records,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) total from c_service a where a.status_cd = \'0\'\",\n                                                             \"param2\":\"SELECT s.`service_id` serviceId,s.`service_code` serviceCode,s.`business_type_cd`  businessTypeCd,s.name `name`,s.is_instance isInstance,\n                                                                       s.`messageQueueName` messageQueueName,s.url url,s.`provide_app_id` provideAppId FROM c_service s WHERE s.`status_cd` = \'0\' LIMIT #page#, #rows#\"\n                                                             }', '', null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {\n                                                        		\"response\": {\n                                                        			\"code\": \"0000\",\n                                                        			\"message\": \"成功\"\n                                                        		}\n                                                        	}\n                                                        }', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('9', 'query.center.route', '查询路由数据', 'page,rows,sord', '1', '{\"param1\":\"select count(1) records,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) total from c_route a,c_service cs WHERE a.`service_id` = cs.`service_id` AND cs.`status_cd` = \'0\' and a.status_cd = \'0\'\",\n                                                             \"param2\":\"SELECT s.id id,s.`app_id` appId,s.`service_id` serviceId,s.`invoke_model` invokeModel,cs.`name` serviceName,cs.`service_code` serviceCode,s.`order_type_cd` orderTypeCd,s.`invoke_limit_times` invokelimitTimes FROM c_route s,c_service cs WHERE s.`service_id` = cs.`service_id` AND cs.`status_cd` = \'0\' AND s.`status_cd` = \'0\' LIMIT #page#, #rows#\"\n                                                             }', '', null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {\n                                                        		\"response\": {\n                                                        			\"code\": \"0000\",\n                                                        			\"message\": \"成功\"\n                                                        		}\n                                                        	}\n                                                        }', '', '2018-11-14 13:28:45', '0');
INSERT INTO `c_service_sql` VALUES ('10', 'query.console.caches', '查询缓存数据', 'row,page', '1', '{\r\n	\"param1\": \"SELECT count(1) total,ceil(#page#/#row#)+1 page,ceil(count(1)/#row#) records FROM c_cache c WHERE c.`status_cd` = \'0\' AND c.`group` = \'COMMON\'\",\r\n	\"param2\": \"SELECT c.id id,c.`cache_code` cacheCode, c.`name` cacheName FROM c_cache c WHERE c.`status_cd` = \'0\' AND c.`group` = \'COMMON\' ORDER BY c.`seq` ASC LIMIT #page#,#row# \"\r\n}', '', null, '{\r\n                                                        	\"PARAM\": {\r\n                                                        		\"param1\": \"$.##Object\",\r\n                                                        		\"param2\": \"$.#caches#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', '', '2018-11-14 13:28:45', '0');
