INSERT INTO `c_service_sql` VALUES ('15', 'query.staff.infos', '查询员工信息', '1', '1', '{\"param1\":\"select count(1) total,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) records  from u_user a \r\n	<if test=\\\"parentOrgId !=null and parentOrgId != \'\'\\\">\r\n		,u_org uo\r\n		,u_org_staff_rel uosr\r\n	</if>\r\n where a.level_cd = \'01\' \r\n <if test=\\\"parentOrgId !=null and parentOrgId != \'\'\\\">\r\n		and a.user_id = uosr.staff_id\r\n		and uosr.store_id = #storeId#\r\n		and uosr.org_id = uo.org_id\r\n		and uo.parent_org_id = #parentOrgId#\r\n		and uo.org_id = #orgId#\r\n        and a.status_cd = \'0\'\r\n		and uo.status_cd = \'0\'\r\n		and uosr.status_cd = \'0\'\r\n	</if>\r\n \",\r\n\"param2\":\"select a.user_id userId,a.name,a.email,a.address,a.sex,a.status_cd statusCd,a.tel,a.create_time createTime from u_user a\r\n<if test=\\\"parentOrgId !=null and parentOrgId != \'\'\\\">\r\n		,u_org uo\r\n		,u_org_staff_rel uosr\r\n	</if>\r\n	 where a.level_cd = \'01\'\r\n<if test=\\\"parentOrgId !=null and parentOrgId != \'\'\\\">\r\n		and a.user_id = uosr.staff_id\r\n		and uosr.store_id = #storeId#\r\n		and uosr.org_id = uo.org_id\r\n		and uo.parent_org_id = #parentOrgId#\r\n		and uo.org_id = #orgId#\r\n        and a.status_cd = \'0\'\r\n		and uo.status_cd = \'0\'\r\n		and uosr.status_cd = \'0\'\r\n	</if>\r\n LIMIT #page#, #rows#\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2018-12-09 07:50:18', '0');
INSERT INTO `c_service_sql` VALUES ('16', 'search.staff.infos', '搜索员工信息', 'page,rows,search', '1', '{\"param1\":\"select count(1) total,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) records  from u_user a where a.level_cd = \'01\' and a.name = #search#\",\n\"param2\":\"select a.user_id userId,a.name,a.email,a.address,a.sex,a.status_cd statusCd,a.tel,a.create_time createTime from u_user a where a.level_cd = \'01\' and a.name = #search# LIMIT #page#, #rows#\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2018-12-12 10:21:55', '0');
INSERT INTO `c_service_sql` VALUES ('17', 'query.community.infos', '查询小区信息', 'page,rows', '1', '{\"param1\":\"select count(1) total,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) records \nfrom s_store a,s_member_store b,s_store c where a.store_type_cd = \'800900000000\' \nand a.store_id = b.store_id and b.member_id = c.store_id and c.store_type_cd = \'800900000002\'\nand a.status_cd = \'0\' and b.status_cd = \'0\' and c.status_cd = \'0\'\",\n\"param2\":\"select a.store_id storeId,a.name storeName,a.nearby_landmarks nearByLandmarks,a.address address,c.name agentName,c.tel agentTel,a.create_time createTime\nfrom s_store a,s_member_store b,s_store c where a.store_type_cd = \'800900000000\' \nand a.store_id = b.store_id and b.member_id = c.store_id and c.store_type_cd = \'800900000002\'\nand a.status_cd = \'0\' and b.status_cd = \'0\' and c.status_cd = \'0\' LIMIT #page#, #rows#\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2018-12-12 14:22:05', '0');
INSERT INTO `c_service_sql` VALUES ('18', 'search.community.infos', '搜索小区', 'page,rows,search', '1', '{\"param1\":\"select count(1) total,ceil(#page#/#rows#)+1 page,ceil(count(1)/#rows#) records \nfrom s_store a,s_member_store b,s_store c where a.store_type_cd = \'800900000000\' \nand a.store_id = b.store_id and b.member_id = c.store_id and c.store_type_cd = \'800900000002\'\nand a.status_cd = \'0\' and b.status_cd = \'0\' and c.status_cd = \'0\' and a.name = #search#\",\n\"param2\":\"select a.store_id storeId,a.name storeName,a.nearby_landmarks nearByLandmarks,a.address address,c.name agentName,c.tel agentTel,a.create_time createTime\nfrom s_store a,s_member_store b,s_store c where a.store_type_cd = \'800900000000\' \nand a.store_id = b.store_id and b.member_id = c.store_id and c.store_type_cd = \'800900000002\'\nand a.status_cd = \'0\' and b.status_cd = \'0\' and c.status_cd = \'0\' and a.name = #search# LIMIT #page#, #rows#\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#rows#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2018-12-12 14:56:10', '0');
INSERT INTO `c_service_sql` VALUES ('19', 'check.property.staffHasProperty', '判断是否有查询物业信息', 'userId', '1', '{\"param1\":\"select count(1) count from p_property p,p_property_user pu\nwhere p.property_id = pu.property_id\nand pu.rel_cd = \'600311000002\'\nand p.status_cd = \'0\'\nand pu.status_cd = \'0\'\n and pu.user_id = #userId#\"}', null, null, '{\"PARAM\": {\"param1\": \"$.##Object\"},\"TEMPLATE\": {}}', null, '2019-02-13 12:18:27', '0');
INSERT INTO `c_service_sql` VALUES ('20', 'query.property.info', '查询物业信息', 'userId', '1', '{\"param1\":\"SELECT p.property_id propertyId,p.map_x mapX,p.map_y mapY,p.b_id bId,p.name name,p.nearby_landmarks nearbyLandmarks,p.tel tel\nFROM p_property p,p_property_user pu\nWHERE p.property_id = pu.property_id AND pu.rel_cd = \'600311000002\' AND p.status_cd = \'0\' AND pu.status_cd = \'0\' and pu.user_id = #userId#\",\n\"param2\":\"select a.attr_id attrId,a.spec_cd specCd,s.name propertyAttrName,a.value propertyAttrValue from p_property_attr a,spec s where a.property_id = #PARENT_propertyId# and a.spec_cd = s.spec_cd\n and s.domain = \'PROPERTY\'\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#attrs#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2019-02-17 14:22:54', '0');
INSERT INTO `c_service_sql` VALUES ('21', 'query.store.byuser', '通过用户ID查询参与组织信息', 'userId', '1', '{\"param1\":\"select ss.store_id storeId,ss.name,ss.address,ss.tel,ss.store_type_cd storeTypeCd,ss.nearby_landmarks nearbyLandmarks,ss.map_x mapX,ss.map_y mapY,ssu.user_id userId,ssu.rel_cd relCd from s_store ss,s_store_user ssu where ss.store_id = ssu.store_id and ssu.user_id = #userId# and ss.status_cd = \'0\' and ssu.status_cd = \'0\'\",\"param2\":\"select ssa.attr_id attrId,ssa.spec_cd specCd,ssa.value from s_store_attr ssa where ssa.store_id = #PARENT_storeId# and ssa.status_cd = \'0\'\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\",\n                                                        		\"param2\": \"$.#attrs#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2019-03-26 15:50:34', '0');
INSERT INTO `c_service_sql` VALUES ('22', 'check.hasUser.byNameOrTel', '判断是否存在用户名或手机号的用户', 'name,tel', '1', '{\"param1\":\"select count(1) userCount from u_user a where 1=1\n<if test=\\\"name !=null and name !=\'\'\\\">\nand a.name = #name# \n</if>\n<if test=\\\"tel !=null and tel !=\'\'\\\">\nand a.tel = #tel# \n</if>\nand a.status_cd = \'0\'\"}', null, null, '{\n                                                        	\"PARAM\": {\n                                                        		\"param1\": \"$.##Object\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2019-03-27 13:40:18', '0');
INSERT INTO `c_service_sql` VALUES ('23', 'query.store.type', '查询商户类型', 'type', '1', '{\"param1\":\"SELECT a.`store_type_cd` storeTypeCd,a.name,a.`id` FROM store_type a where a.is_show=0\"}', null, null, '{\"PARAM\": {\"param1\": \"$.#storeType#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-03-28 03:20:30', '0');
INSERT INTO `c_service_sql` VALUES ('24', 'query.user.privilege', '查询用户权限', 'userId,domain', '1', '{\"param1\":\"SELECT  DISTINCT  tt.gName,tt.gId,tt.mName,tt.mId,tt.pName,tt.pId, tt.pgId,tt.pgName,tt.seq  FROM (\nselect mmg.`name` gName,mmg.g_id gId,m.`name` mName,m.m_id mId,p.`name` pName,p.p_id pId, ppg.pg_id pgId,ppg.name pgName,mmg.seq\nfrom m_menu_group mmg\nINNER JOIN m_menu m on mmg.g_id = m.g_id and m.status_cd = \'0\'\ninner join p_privilege p on m.m_id = p.m_id and p.status_cd = \'0\' and p.domain in (#domain#,\'9999\')\ninner join p_privilege_rel ppr on ppr.p_id = p.p_id and ppr.status_cd = \'0\' \ninner join p_privilege_group ppg on ppr.pg_id = ppg.pg_id and ppg.status_cd = \'0\'\ninner join p_privilege_user ppu on ppu.p_id  = ppg.pg_id and ppu.privilege_flag = \'1\' and ppu.status_cd = \'0\' and ppu.user_id = #userId#\nwhere mmg.status_cd = \'0\'\nunion\nselect mmg.`name` gName,mmg.g_id gId,m.`name` mName,m.m_id mId,p.`name` pName,p.p_id pId, \'-1\' pgId,\'\' pgName,mmg.seq\nfrom m_menu_group mmg\nINNER JOIN m_menu m on mmg.g_id = m.g_id and m.status_cd = \'0\'\ninner join p_privilege p on m.m_id = p.m_id and p.status_cd = \'0\' and p.domain in (#domain#,\'9999\')\ninner join p_privilege_user ppu on ppu.p_id  = p.p_id and ppu.privilege_flag = \'0\' and ppu.status_cd = \'0\' and ppu.user_id = #userId#\nwhere mmg.status_cd = \'0\'\n) tt\norder by tt.seq asc \"}', null, null, '{\"PARAM\": {\"param1\": \"$.#privileges#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-01 03:08:08', '0');
INSERT INTO `c_service_sql` VALUES ('25', 'query.user.userInfo', '查询用户信息', 'userId', '1', '{\"param1\":\"SELECT \r\n  a.`user_id` userId,\r\n  a.name,\r\n  a.email,\r\n  a.`address`,\r\n  a.`location_cd` localtionCd,\r\n  a.sex,\r\n  a.tel,\r\n  a.`level_cd` levelCd,\r\n  a.status_cd statusCd,\r\n  a.create_time createTime \r\nFROM\r\n  u_user a \r\nWHERE a.`user_id` = #userId# \r\n\"}', null, null, '{\"PARAM\": {\"param1\": \"$.##Object\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-01 11:43:00', '0');
INSERT INTO `c_service_sql` VALUES ('26', 'query.store.users', '查询商户用户', 'page,rows,storeId', '1', '{\"param1\":\"SELECT COUNT(1) total,CEIL(#page#/#rows#)+1 page,ceil(count(1)/#rows#) records  \r\nFROM s_store ss,s_store_user ssu WHERE ss.`store_id` = ssu.`store_id`\r\nAND ss.`store_id` = #storeId#\r\nAND ss.`status_cd` = \'0\'\r\nAND ssu.`status_cd` = \'0\'\",\r\n\"param2\":\"SELECT \r\n  ss.`store_id` storeId,\r\n  ssu.`rel_cd` relCd,\r\n  ssu.`user_id` userId \r\nFROM\r\n  s_store ss,\r\n  s_store_user ssu \r\nWHERE ss.`store_id` = ssu.`store_id` \r\n  AND ss.`store_id` = #storeId#\r\n  AND ss.`status_cd` = \'0\' \r\n  AND ssu.`status_cd` = \'0\'\r\nLIMIT #page#, #rows#  \"}', null, null, '{\r\n                                                        	\"PARAM\": {\r\n                                                        		\"param1\": \"$.##Object\",\r\n                                                        		\"param2\": \"$.#datas#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-02 12:08:45', '0');
INSERT INTO `c_service_sql` VALUES ('27', 'query.store.privilegeGroup', '根据商户查询权限组', 'storeId,storeTypeCd', '1', '{\"param1\":\"select a.pg_id pgId,a.name,a.description,a.create_time createTime,a.store_id storeId,a.domain storeTypeCd,a.seq from p_privilege_group a <if test=\\\"communityId !=null and communityId != \'\'\\\"> left join u_role_community b on a.pg_id=b.role_id</if> where a.status_cd = \'0\' and a.store_id in (#storeId#) and a.domain = #storeTypeCd# <if test=\\\"communityId !=null and communityId != \'\'\\\"> and b.community_id=#communityId# and b.status_cd=0</if> order by a.seq*1 asc\"}', null, null, '{\"PARAM\": {\"param1\": \"$.#privilegeGroups#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2019-04-05 15:36:19', '0');
INSERT INTO `c_service_sql` VALUES ('28', 'query.privilege.byPgId', '根据权限组ID查询权限', '1', '1', '{\"param1\":\"select pp.p_id pId,pp.name,pp.description,pp.create_time createTime from p_privilege pp,p_privilege_rel ppr\r\nwhere pp.p_id = ppr.p_id\r\nand ppr.pg_id = #pgId#\r\n<if test=\\\"name !=null and name !=\'\'\\\">\r\nand pp.name like concat(\'%\',#name#,\'%\')\r\n</if>\r\nand pp.status_cd = \'0\'\r\nand ppr.status_cd = \'0\'\"}', null, null, '{\"PARAM\": {\"param1\": \"$.#privileges#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2019-04-07 10:27:19', '0');
INSERT INTO `c_service_sql` VALUES ('29', 'query.privilegeGroup.noAddPrivilege', '查询权限组中未添加的权限', 'storeId,pgId,storeTypeCd', '1', '{\"param1\":\"\n	select DISTINCT mmg.`name` gName,mmg.g_id gId,m.`name` mName,m.m_id mId,p.`name` pName,p.p_id pId, ppg.pg_id pgId,mmg.seq\nfrom m_menu_group mmg\nINNER JOIN m_menu m on mmg.g_id = m.g_id and m.status_cd = \'0\'\ninner join p_privilege p on m.m_id = p.m_id and p.status_cd = \'0\' and p.domain in (#storeTypeCd#,\'9999\')\n<if test=\\\"communityId!=null \\\">\ninner join m_menu_group_community mgc on mgc.g_id = mmg.g_id and mgc.status_cd = \'0\'\n</if>\nleft join p_privilege_rel ppr on ppr.p_id = p.p_id and ppr.status_cd = \'0\' \nleft join p_privilege_group ppg on ppg.pg_id = #pgId# and ppg.store_id = #storeId# and ppr.pg_id = ppg.pg_id and ppg.status_cd = \'0\'\nwhere mmg.status_cd = \'0\'\n<if test=\\\"communityId!=null \\\">\nand mgc.community_id = #communityId#\n</if>\norder by mmg.seq asc\n\"} ', null, null, '{\"PARAM\": {\"param1\": \"$.#privileges#Array\"\n                                                        	},\n                                                        	\"TEMPLATE\": {}\n                                                        }', null, '2019-04-08 14:44:15', '0');
INSERT INTO `c_service_sql` VALUES ('30', 'query.user.byName', '根据用户名称查询用户', 'name', '1', '{\"param1\":\"\r\nSELECT \r\n  a.`user_id` userId,\r\n  a.name,\r\n  a.email,\r\n  a.`address`,\r\n  a.`location_cd` localtionCd,\r\n  a.sex,\r\n  a.tel,\r\n  a.`level_cd` levelCd,\r\n  a.status_cd statusCd,\r\n  a.create_time createTime \r\nFROM\r\n  u_user a \r\nWHERE a.`name` = #name# \r\n\"}', null, null, '{\"PARAM\": {\"param1\": \"$.#users#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-10 06:03:50', '0');
INSERT INTO `c_service_sql` VALUES ('31', 'query.storeUser.byUserIds', '根据用户ID查询是不是商户ID', 'userIds,storeId', '1', '{\"param1\":\"\r\nSELECT a.`user_id` userId,a.`rel_cd` relCd,a.`store_user_id` storeUserId,a.`store_id` storeId,a.`user_id` userId FROM s_store_user a WHERE a.`user_id` IN (#userIds#) and a.`store_id` = #storeId# and a.status_cd = \'0\'\r\n\"}', null, null, '{\"PARAM\": {\"param1\": \"$.#storeUsers#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-11 01:12:30', '0');
INSERT INTO `c_service_sql` VALUES ('32', 'query.privilegeGroup.noAddPrivilegeGroup', '查询没有给员工赋权限组', 'userId,storeId,storeTypeCd', '1', '{\"param1\":\"\r\nSELECT \r\n  ppg.`pg_id` pgId,\r\n  ppg.`name`,\r\n  ppg.`description`,\r\n  ppg.`create_time` createTime,\r\n  ppg.`store_id` storeId,\r\n  ppg.`domain` \r\nFROM\r\n  p_privilege_group ppg \r\nWHERE ppg.`domain` = #storeTypeCd#\r\n  AND ppg.`store_id` = #storeId#\r\n  AND ppg.`status_cd` = \'0\' \r\n  AND NOT EXISTS \r\n  (SELECT \r\n    1 \r\n  FROM\r\n    p_privilege_user ppu \r\n  WHERE ppu.`status_cd` = \'0\' \r\n    AND ppu.`user_id` = #userId#\r\n    AND ppu.`p_id` = ppg.`pg_id` \r\n    AND ppu.`privilege_flag` = \'1\')\r\n\"\r\n}', null, null, '{\"PARAM\": {\"param1\": \"$.#privilgeGroups#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-13 03:39:47', '0');
INSERT INTO `c_service_sql` VALUES ('33', 'query.privilege.noAddPrivilege', '查询没有给员工赋权限', 'userId,storeId,storeTypeCd', '1', '{\"param1\":\"\r\nSELECT \r\n  pp.`p_id` pId,\r\n  pp.`name`,\r\n  pp.`description`,\r\n  pp.`create_time` createTime,\r\n  pp.`domain` \r\nFROM\r\n  p_privilege pp \r\nWHERE pp.`domain` = #storeTypeCd#\r\n  AND pp.`status_cd` = \'0\' \r\n  AND NOT EXISTS \r\n  (SELECT \r\n    1 \r\n  FROM\r\n    p_privilege_user ppu \r\n  WHERE ppu.p_id = pp.`p_id` \r\n    AND ppu.privilege_flag = \'0\' \r\n    AND ppu.user_id = #userId#\r\n    AND ppu.status_cd = \'0\')\r\n\"\r\n}', null, null, '{\"PARAM\": {\"param1\": \"$.#privilges#Array\"\r\n                                                        	},\r\n                                                        	\"TEMPLATE\": {}\r\n                                                        }', null, '2019-04-13 05:17:12', '0');
INSERT INTO `c_service_sql` VALUES ('34', 'query.myCommunity.byMember', '查询商户入驻小区信息', 'memberId,memberTypeCd', '1', '{\n	\"param1\": \"SELECT\n	sc.`community_id` communityId,\n	sc.`name`,\n	sc.`address`,\n	sc.`nearby_landmarks` nearbyLandmarks,\n	sc.`city_code` cityCode,\n	sc.`map_x` mapX,\n	sc.`map_y` mapY,\n	scm.`community_member_id` communityMemberId,\n	scm.`member_id` memberId,\n	scm.`member_type_cd` memberTypeCd,\n	scm.audit_status_cd auditStatusCd,\n	scm.`status_cd` statusCd,\n	ca.area_name areaName,\n	ca.parent_area_name cityName,\n	ca1.parent_area_name provName,\n	sc.community_area communityArea\nFROM\n	s_community sc,\n	s_community_member scm,\n	city_area ca,\n	city_area ca1\nWHERE\n	sc.`community_id` = scm.`community_id`\nAND sc.`status_cd` = \'0\'\nand sc.city_code = ca.area_code\nand ca.parent_area_code = ca1.area_code\nAND scm.`member_id` = #memberId#   AND scm.`member_type_cd` = #memberTypeCd#   AND scm.`status_cd` = \'0\' \n<if test=\\\"auditStatusCd ==null or auditStatusCd ==\'\'\\\">\nand scm.audit_status_cd in (\'1000\', \'1100\',\'1200\')\n</if>\n<if test=\\\"auditStatusCd !=null and auditStatusCd !=\'\'\\\">\nand scm.audit_status_cd = #auditStatusCd#\n</if>\ngroup by sc.community_id\n\",\n	\"param2\": \"select sca.attr_id attrId,sca.spec_cd specCd,sca.value,s.name from s_community_attr sca,spec s where sca.status_cd = \'0\' and sca.community_id = #PARENT_communityId# and s.domain=\'COMMUNITY_ATTR\' and s.spec_cd=sca.spec_cd\"\n}', null, null, '{\"PARAM\": {\"param1\": \"$.#communitys#Array\",\"param2\":\"$.communitys.#attrs#Array\"},\"TEMPLATE\": {}}', null, '2019-04-15 03:36:02', '0');
INSERT INTO `c_service_sql` VALUES ('35', 'query.noEnterCommunity.byMember', '查询商户未入驻小区信息', '1', '1', '{\"param1\":\"SELECT sc.community_id communityId, sc.name, sc.address, sc.nearby_landmarks nearbyLandmarks, sc.city_code cityCode, sc.map_x mapX, sc.map_y mapY\nFROM\n	s_community sc\nLEFT JOIN s_community_member scm ON sc.community_id = scm.community_id\nAND scm.member_type_cd = \'390001200002\'\nand scm.status_cd <> \'1\'\nand scm.audit_status_cd <> \'1200\'\n<if test=\\\"memberId !=null and memberId !=\'\'\\\">\nand scm.member_id = #memberId#\n</if>\nWHERE\n	sc.status_cd = \'0\'\nand sc.state=\'1100\'\nAND scm.community_id IS NULL\",\"param2\":\"select sca.attr_id attrId,sca.spec_cd specCd,sca.value,s.name from s_community_attr sca,spec s where sca.status_cd = \'0\' and sca.community_id = #PARENT_communityId# and s.domain=\'COMMUNITY_ATTR\' and s.spec_cd=sca.spec_cd\"}', null, null, '{\"PARAM\": {\"param1\": \"$.#communitys#Array\",\"param2\":\"$.communitys.#attrs#Array\"},\"TEMPLATE\": {}}', null, '2019-04-15 14:38:38', '0');
INSERT INTO `c_service_sql` VALUES ('36', 'check.user.hasPrivilege', '检查用户是否有权限', 'pId,userId', '1', '{\"param1\":\"SELECT  DISTINCT  tt.p_id `pId`,tt.name,tt.pg_id pgId,tt.pg_name pgName,tt.description,tt.create_time createTime FROM (\n	SELECT pp.*,\'-1\' AS pg_id,\'\' AS pg_name FROM p_privilege_user ppu,p_privilege pp\n	WHERE ppu.`p_id` = pp.`p_id`\n	AND pp.p_id = #pId#\n	AND ppu.`privilege_flag` = \'0\'\n	AND ppu.`user_id` = #userId#\n	AND ppu.`status_cd` = \'0\'\n	AND pp.`status_cd` = \'0\'\n	UNION\n	SELECT pp.*,ppg.pg_id,ppg.name pg_name FROM p_privilege_user ppu,p_privilege_group ppg,p_privilege pp,p_privilege_rel ppr\n	WHERE ppu.`p_id` = ppr.pg_id\n	AND ppr.pg_id = ppg.pg_id\n	AND ppr.p_id = pp.`p_id`\n	AND pp.p_id = #pId#\n	AND ppu.`privilege_flag` = \'1\'\n	AND ppu.`user_id` = #userId#\n	AND ppu.`status_cd` = \'0\'\n	AND pp.`status_cd` = \'0\'\n	AND ppg.status_cd = \'0\'\n	AND ppr.status_cd = \'0\'\n) tt  \"}', null, null, '{\"PARAM\": {\"param1\": \"$.#privileges#Array\"},\"TEMPLATE\": {}}', null, '2019-04-16 01:14:43', '0');
INSERT INTO `c_service_sql` VALUES ('37', 'query.noEnterCommunity.byMemberAndName', '根据商户名称查询未入住小区信息', '1', '1', '{\"param1\":\"SELECT sc.community_id communityId, sc.name, sc.address, sc.nearby_landmarks nearbyLandmarks, sc.city_code cityCode, sc.map_x mapX, sc.map_y mapY\r\nFROM\r\n	s_community sc\r\nLEFT JOIN s_community_member scm ON sc.community_id = scm.community_id\r\nAND scm.member_type_cd = \'390001200002\'\r\nand scm.status_cd <> \'1\'\r\nand scm.audit_status_cd <> \'1200\'\r\n<if test=\\\"memberId !=null and memberId !=\'\'\\\">\r\nand scm.member_id = #memberId#\r\n</if>\r\nWHERE\r\n	sc.status_cd = \'0\'\r\nand sc.state=\'1100\'\r\n<if test=\\\"name !=null and name !=\'\'\\\">\r\nand sc.name like concat(\'%\',#name#,\'%\')\r\n</if>\r\nAND scm.community_id IS NULL\",\"param2\":\"select sca.attr_id attrId,sca.spec_cd specCd,sca.value,s.name from s_community_attr sca,spec s where sca.status_cd = \'0\' and sca.community_id = #PARENT_communityId# and s.domain=\'COMMUNITY_ATTR\' and s.spec_cd=sca.spec_cd\"}\r\n', null, null, '{\"PARAM\": {\"param1\": \"$.#communitys#Array\",\"param2\":\"$.communitys.#attrs#Array\"},\"TEMPLATE\": {}}', null, '2019-04-18 01:22:36', '0');
INSERT INTO `c_service_sql` VALUES ('38', '123', '111', '1', '', '', '', '', '', '', '2019-09-03 11:22:05', '1');
INSERT INTO `c_service_sql` VALUES ('39', 'serviceProvide.listServiceProvides1', '查询服务提供1', 'memberId,memberTypeCd,name1', '1', '{\"param1\":\"SELECT sc.community_id communityId, sc.name, sc.address, sc.nearby_landmarks nearbyLandmarks, sc.city_code cityCode, sc.map_x mapX, sc.map_y mapY\nFROM s_community sc\nWHERE sc.status_cd = \'0\'\nand sc.name = #name#\nand not exists(\n	select 1 from s_community_member scm \n    where scm.status_cd <> \'1\'\n    and scm.community_id = sc.community_id\n    and scm.member_id = #memberId#\n    and scm.member_type_cd = #memberTypeCd#\n)\",\"param2\":\"select sca.attr_id attrId,sca.spec_cd specCd,sca.value,s.name from s_community_attr sca,spec s where sca.status_cd = \'0\' and sca.community_id = #PARENT_communityId# and s.domain=\'COMMUNITY_ATTR\' and s.spec_cd=sca.spec_cd\"}1', '', '', '{\"PARAM\": {\"param1\": \"$.#communitys#Array\",\"param2\":\"$.communitys.#attrs#Array\"},\"TEMPLATE\": {}}1', '', '2019-09-03 12:58:17', '1');
INSERT INTO `c_service_sql` VALUES ('40', 'api.queryNotices', '查询通知列表', '1', '1', '{\"param1\":\"SELECT nn.`notice_id` noticeId,nn.`title`,nn.`notice_type_cd` noticeTypeCd,nn.`context`,nn.`community_id` communityId,nn.`user_id` userId,nn.`start_time` startTime FROM n_notice nn\nWHERE nn.status_cd = \'0\'\n<if test=\\\"noticeId !=null and noticeId !=\'\'\\\">\nand nn.`notice_id` = #noticeId#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\'\\\">\nand nn.`community_id` = #communityId#\n</if>\n<if test=\\\"userId !=null and userId !=\'\'\\\">\nand nn.`user_id` = #userId#\n</if>\n<if test=\\\"title !=null and title !=\'\'\\\">\nand nn.`title` LIKE CONCAT(\'%\',#title#,\'%\')\n</if>\"}', '', '', '{\"PARAM\": {\"param1\": \"$.#notices#Array\"},\"TEMPLATE\": {}}', '', '2019-09-08 03:24:33', '0');
INSERT INTO `c_service_sql` VALUES ('41', 'api.getNoticesByJava', '查询通知（java）', '1', '3', '', '', 'import com.alibaba.fastjson.JSONObject;\nimport com.java110.service.context.DataQuery;\nimport com.java110.service.develop.IDevelop;\nimport org.apache.commons.lang.StringUtils;\nimport java.util.ArrayList;\nimport java.util.List;\n\npublic JSONObject execute(DataQuery dataQuery) {\n        JSONObject params = dataQuery.getRequestParams();\n        List sqlParams = new ArrayList();\n        String sql = \"SELECT nn.`notice_id` noticeId,\" +\n                \"nn.`title`,\" +\n                \"nn.`notice_type_cd` noticeTypeCd,\" +\n                \"nn.`context`,\" +\n                \"nn.`community_id` communityId,\" +\n                \"nn.`user_id` userId,\" +\n                \"nn.`start_time` startTime \" +\n                \"FROM n_notice nn\\n\" +\n                \"WHERE nn.status_cd = \'0\'\" ;\n        if(params.containsKey(\"noticeId\") && !StringUtils.isEmpty(params.getString(\"noticeId\"))){\n            sql += \"and nn.`notice_id` = ? \";\n            sqlParams.add(params.get(\"noticeId\"));\n        }\n        if(params.containsKey(\"communityId\") && !StringUtils.isEmpty(params.getString(\"communityId\"))){\n            sql += \"and nn.`community_id` = ? \";\n            sqlParams.add(params.get(\"communityId\"));\n        }\n        if(params.containsKey(\"userId\") && !StringUtils.isEmpty(params.getString(\"userId\"))){\n            sql += \"and nn.`user_id` = ? \";\n            sqlParams.add(params.get(\"userId\"));\n        }\n        if(params.containsKey(\"title\") && !StringUtils.isEmpty(params.getString(\"title\"))){\n            sql += \"and nn.`title` LIKE CONCAT(\'%\',?,\'%\') \";\n            sqlParams.add(params.get(\"title\"));\n        }\n\n        List outParam = dataQuery.queryDataBySql(sql,sqlParams);\n\n        JSONObject outObj = new JSONObject();\n        outObj.put(\"notices\", outParam);\n        return outObj;\n    }', '', '', '2019-09-08 06:48:55', '0');
INSERT INTO `c_service_sql` VALUES ('42', 'api.getPropertyPayFee', '缴费清单', '1', '1', '{\"param1\":\"SELECT td.`name` feeTypeCdName,pfc.fee_name feeName,oo.`name` payObjName, pfd.`detail_id` detailId,pfd.`cycles`,\n pfd.`receivable_amount` receivableAmount,pfd.`received_amount` receivedAmount,uu.`name` userName,pf.fee_id feeId,DATE_FORMAT(pfd.create_time,\'%Y-%m-%d %H:%i:%s\') createTime,td2.`name` primeRate  \nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\nleft join building_owner_room_rel borr on borr.`room_id` = pf.`payer_obj_id` AND borr.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = borr.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE \n1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'3333\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId != \'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.config_id = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.prime_rate= #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>\norder by pfd.create_time desc \nlimit #page#,#row#\",\n\"param2\":\"SELECT count(1) total\nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\'\nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\nleft join building_owner_room_rel borr on borr.`room_id` = pf.`payer_obj_id` AND borr.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = borr.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE \n1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'3333\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId != \'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!= \'\' \\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.config_id = #configId#\n</if>\",\n\"param3\":\"SELECT \nSUM(pfd.`receivable_amount`) allReceivableAmount,SUM(pfd.`received_amount`) allReceivedAmount\nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\nleft join building_owner_room_rel borr on borr.`room_id` = pf.`payer_obj_id` AND borr.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = borr.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE \n1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'3333\'\nand pfd.state not in(1100,1300,1500)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId != \'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.config_id = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.prime_rate= #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>\"\n}', '', '', '{\"PARAM\": {\"param1\": \"$.#payFees#Array\",\"param2\":\"$.##Object\",\"param3\":\n\"$.#payFeeSum#Array\"},\"TEMPLATE\": {}}', '', '2019-10-30 22:18:13', '0');
INSERT INTO `c_service_sql` VALUES ('43', 'api.getParkingSpacePayFee', '停车费缴费清单', '1', '1', '{\"param1\":\"SELECT td.`name` feeTypeCdName,pfc.fee_name feeName,oo.`name` payObjName, pfd.`detail_id` detailId,pfd.`cycles`,\n pfd.`receivable_amount` receivableAmount,pfd.`received_amount` receivedAmount,uu.`name` userName,pf.fee_id feeId,DATE_FORMAT(pfd.create_time,\'%Y-%m-%d %H:%i:%s\') createTime,td2.`name` primeRate \nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\n left join owner_car oc on oc.car_id = pf.`payer_obj_id` AND oc.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = oc.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE 1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'6666\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.`config_id` = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>\norder by pfd.create_time desc\nlimit #page#,#row#\",\n\"param2\":\"SELECT count(1) total\nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\n left join owner_car oc on oc.car_id = pf.`payer_obj_id` AND oc.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = oc.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE 1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'6666\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.`config_id` = #configId#\n</if>\",\n\"param3\":\"SELECT \nSUM(pfd.`receivable_amount`) allReceivableAmount,SUM(pfd.`received_amount`) allReceivedAmount\nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\n left join owner_car oc on oc.car_id = pf.`payer_obj_id` AND oc.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = oc.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE 1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'6666\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.`config_id` = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>\"\n}', '', '', '{\"PARAM\": {\"param1\": \"$.#payFees#Array\",\"param2\":\"$.##Object\",\"param3\":\n\"$.#payFeeSum#Array\"},\"TEMPLATE\": {}}', '', '2019-10-31 14:10:39', '0');
INSERT INTO `c_service_sql` VALUES ('44', 'api.getStaffFee', '员工收取的费用', '1', '1', '{\"param1\":\"SELECT uu.`name` userName,uu.`user_id` userId,SUM(bpfd.`receivable_amount`) receivableAmount,SUM(bpfd.`received_amount`) receivedAmount\n FROM c_orders co,c_business cb,pay_fee_detail bpfd,u_user uu,s_store_user su,pay_fee pf\nWHERE co.`o_id` = cb.`o_id`\nAND cb.`b_id` = bpfd.`b_id`\nand bpfd.fee_id = pf.fee_id\nand pf.status_cd = \'0\'\nAND co.`user_id` = uu.`user_id`\nAND uu.`user_id` = su.`user_id`\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand su.`store_id` = #storeId#\n</if>\n<if test=\\\"userCode !=null and userCode !=\'\'\\\">\nand uu.`user_id` = #userCode#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND co.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND co.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\'\\\">\nand bpfd.`community_id` = #communityId#\n</if>\ngroup by uu.`name`,uu.`user_id`\nlimit #page#,#row#\",\n\"param2\":\"select count(1) total from (SELECT uu.`name`,uu.`user_id`\n FROM c_orders co,c_business cb,pay_fee_detail bpfd,u_user uu,s_store_user su,pay_fee pf\nWHERE co.`o_id` = cb.`o_id`\nAND cb.`b_id` = bpfd.`b_id`\nand bpfd.fee_id = pf.fee_id\nand pf.status_cd = \'0\'\nAND co.`user_id` = uu.`user_id`\nAND uu.`user_id` = su.`user_id`\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand su.`store_id` = #storeId#\n</if>\n<if test=\\\"userCode !=null and userCode !=\'\'\\\">\nand uu.`user_id` = #userCode#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND co.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND co.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\'\\\">\nand bpfd.`community_id` = #communityId#\n</if>\ngroup by uu.`name`,uu.`user_id`) t\"\n}', '', '', '{\"PARAM\": {\"param1\": \"$.#staffFees#Array\",\"param2\":\"$.##Object\"},\"TEMPLATE\": {}}', '', '2019-11-01 14:01:06', '0');
INSERT INTO `c_service_sql` VALUES ('45', 'api.getTempCarInoutFee', '临时车缴费清单', '1', '1', '{\"param1\":\"select py.fee_id feeId, \r\nci.inout_id inoutId,\r\nci.car_num carNum,\r\ncb.o_id oId,\r\npfd.receivable_amount receivableAmount,\r\npfd.received_amount receivedAmount,\r\nDATE_FORMAT(py.start_time,\'%Y-%m-%d %H:%i:%s\')  startTime,\r\nDATE_FORMAT(py.end_time,\'%Y-%m-%d %H:%i:%s\') endTime,\r\n\'微信支付\' userName,\r\nDATE_FORMAT(cb.create_time,\'%Y-%m-%d %H:%i:%s\') payTime\r\nfrom pay_fee py,pay_fee_detail pfd,car_inout ci,c_business cb\r\nwhere py.payer_obj_id = ci.inout_id\r\nand py.fee_id = pfd.fee_id\r\nand py.fee_flag = \'2006012\'\r\nand py.state = \'2009001\'\r\nand py.b_id = cb.b_id\r\n<if test=\\\"startTime!=null \\\">\r\nAND pfd.`create_time` &gt;= #startTime#\r\n</if>\r\n<if test=\\\"endTime !=null \\\">\r\nAND pfd.`create_time` &lt;= #endTime#\r\n</if>\r\n<if test=\\\"carNum !=null and carNum != \'\' \\\">\r\nAND ci.car_num = #carNum#\r\n</if>\r\n<if test=\\\"communityId !=null and communityId !=\'\'\\\">\r\nand pfd.`community_id` = #communityId#\r\n</if>\r\norder by pfd.create_time desc\r\nlimit #page#,#row#\",\r\n\"param2\":\"SELECT count(1) total\r\n  from pay_fee py,pay_fee_detail pfd,car_inout ci,c_business cb\r\nwhere py.payer_obj_id = ci.inout_id\r\nand py.fee_id = pfd.fee_id\r\nand py.fee_flag = \'2006012\'\r\nand py.state = \'2009001\'\r\nand py.b_id = cb.b_id\r\n<if test=\\\"startTime!=null \\\">\r\nAND pfd.`create_time` &gt;= #startTime#\r\n</if>\r\n<if test=\\\"endTime !=null \\\">\r\nAND pfd.`create_time` &lt;= #endTime#\r\n</if>\r\n<if test=\\\"carNum !=null and carNum != \'\' \\\">\r\nAND ci.car_num = #carNum#\r\n</if>\r\n<if test=\\\"communityId !=null and communityId !=\'\'\\\">\r\nand pfd.`community_id` = #communityId#\r\n</if>\"\r\n}', '', '', '{\"PARAM\": {\"param1\": \"$.#tempCarInoutFees#Array\",\"param2\":\"$.##Object\"},\"TEMPLATE\": {}}', '', '2020-01-27 22:08:43', '0');
INSERT INTO `c_service_sql` VALUES ('46', 'api.queryFeeSummary', '缴费汇总查询', '1', '1', '{\"param1\":\"SELECT\n	DATE_FORMAT(pfd.create_time,#formatStr#) createTime,\n	pfc.config_id configId,\n	pfc.fee_name feeName,\n	SUM(pfd.receivable_amount) receivableAmounts,\n	SUM(pfd.received_amount) receivedAmounts\nFROM\n	pay_fee pf,\n	pay_fee_detail pfd,\n	pay_fee_config pfc\nWHERE\n	pf.config_id = pfc.config_id\nAND pf.fee_id = pfd.fee_id\nand pf.community_id = #communityId#\nAND pf.status_cd = \'0\'\nAND pfc.status_cd = \'0\'\nAND pfd.status_cd = \'0\'\nGROUP BY\n	DATE_FORMAT(pfd.create_time,#formatStr#),\n	pfc.config_id,\n	pfc.fee_name\nORDER BY\n	DATE_FORMAT(pfd.create_time,#formatStr#) DESC\nlimit #page#,#row#\",\n\"param2\":\"SELECT count(1) total from\n  (SELECT\n	DATE_FORMAT(pfd.create_time,#formatStr#) createTime,\n	pfc.config_id configId,\n	pfc.fee_name feeName,\n	SUM(pfd.receivable_amount) receivableAmounts,\n	SUM(pfd.received_amount) receivedAmounts\nFROM\n	pay_fee pf,\n	pay_fee_detail pfd,\n	pay_fee_config pfc\nWHERE\n	pf.config_id = pfc.config_id\nAND pf.fee_id = pfd.fee_id\nAND pf.status_cd = \'0\'\nAND pfc.status_cd = \'0\'\nAND pfd.status_cd = \'0\'\nand pf.community_id = #communityId#\nGROUP BY\n	DATE_FORMAT(pfd.create_time,#formatStr#),\n	pfc.config_id,\n	pfc.fee_name) t\"\n}', '', '', '{\"PARAM\": {\"param1\": \"$.#fees#Array\",\"param2\":\"$.##Object\"},\"TEMPLATE\": {}}', '', '2020-02-03 16:25:30', '0');
INSERT INTO `c_service_sql` VALUES ('47', 'api.getListPayFee', '房屋车辆缴费清单', '1', '1', '\n{\"param1\":\"select * from (select * from (SELECT td.`name` feeTypeCdName,pfc.fee_name feeName,oo.`name` payObjName, pfd.`detail_id` detailId,pfd.`cycles`,\n pfd.`receivable_amount` receivableAmount,pfd.`received_amount` receivedAmount,uu.`name` userName,pf.fee_id feeId,DATE_FORMAT(pfd.create_time,\'%Y-%m-%d %H:%i:%s\') createTime,td2.`name` primeRate  \nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\nleft join building_owner_room_rel borr on borr.`room_id` = pf.`payer_obj_id` AND borr.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = borr.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE \n1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'3333\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId != \'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.config_id = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.prime_rate= #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>) tc\nunion\nselect * from (\nSELECT td.`name` feeTypeCdName,pfc.fee_name feeName,oo.`name` payObjName, pfd.`detail_id` detailId,pfd.`cycles`,\n pfd.`receivable_amount` receivableAmount,pfd.`received_amount` receivedAmount,uu.`name` userName,pf.fee_id feeId,DATE_FORMAT(pfd.create_time,\'%Y-%m-%d %H:%i:%s\') createTime,td2.`name` primeRate \nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\n left join owner_car oc on oc.car_id = pf.`payer_obj_id` AND oc.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = oc.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE 1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'6666\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.`config_id` = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>) rc)s \norder by createTime desc \nlimit #page#,#row#\",\n\"param2\":\"select count(1) total from (select * from (SELECT td.`name` feeTypeCdName,pfc.fee_name feeName,oo.`name` payObjName, pfd.`detail_id` detailId,pfd.`cycles`,\n pfd.`receivable_amount` receivableAmount,pfd.`received_amount` receivedAmount,uu.`name` userName,pf.fee_id feeId,DATE_FORMAT(pfd.create_time,\'%Y-%m-%d %H:%i:%s\') createTime,td2.`name` primeRate  \nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\nleft join building_owner_room_rel borr on borr.`room_id` = pf.`payer_obj_id` AND borr.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = borr.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE \n1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'3333\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId != \'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.config_id = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.prime_rate= #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>) tc\nunion\nselect * from (\nSELECT td.`name` feeTypeCdName,pfc.fee_name feeName,oo.`name` payObjName, pfd.`detail_id` detailId,pfd.`cycles`,\n pfd.`receivable_amount` receivableAmount,pfd.`received_amount` receivedAmount,uu.`name` userName,pf.fee_id feeId,DATE_FORMAT(pfd.create_time,\'%Y-%m-%d %H:%i:%s\') createTime,td2.`name` primeRate \nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\n left join owner_car oc on oc.car_id = pf.`payer_obj_id` AND oc.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = oc.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE 1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'6666\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.`config_id` = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>) rc)s \",\n\"param3\":\"select SUM(allReceivableAmount) allReceivableAmount,SUM(allReceivedAmount) allReceivedAmount from\n((SELECT\nSUM(pfd.`receivable_amount`) allReceivableAmount,SUM(pfd.`received_amount`) allReceivedAmount\nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\nleft join building_owner_room_rel borr on borr.`room_id` = pf.`payer_obj_id` AND borr.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = borr.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE \n1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'3333\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId != \'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.config_id = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.prime_rate= #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>)\nunion\n(SELECT \nSUM(pfd.`receivable_amount`) allReceivableAmount,SUM(pfd.`received_amount`) allReceivedAmount\nFROM pay_fee_detail pfd\nleft join pay_fee pf on pf.`fee_id` = pfd.`fee_id` AND pf.`status_cd` = \'0\' \nleft join pay_fee_config pfc on  pf.config_id = pfc.config_id and pfc.status_cd = \'0\'\nleft join t_dict td on  pfc.`fee_type_cd` = td.`status_cd` AND td.`table_name` = \'pay_fee_config\' AND td.`table_columns` = \'fee_type_cd\'\nleft join t_dict td2 on   pfd.`prime_rate` = td2.`status_cd` AND td2.`table_name` = \'pay_fee_detail\' AND td2.`table_columns` = \'prime_rate\'\nleft join c_business cb on pfd.`b_id` = cb.`b_id` \nleft join c_orders co on cb.`o_id` = co.`o_id`\nleft join u_user uu on co.`user_id` = uu.`user_id`\nleft join s_store ss on pf.`income_obj_id` = ss.`store_id` AND ss.`status_cd` = \'0\'\n left join owner_car oc on oc.car_id = pf.`payer_obj_id` AND oc.`status_cd` = \'0\'\nleft join building_owner oo on oo.`owner_id` = oc.`owner_id` and oo.owner_type_cd = \'1001\' AND oo.`status_cd` = \'0\'\nWHERE 1=1\nAND pfd.`status_cd` = \'0\'\nand pf.payer_obj_type = \'6666\'\nand pfd.state not in(1100,1300)\n<if test=\\\"storeId !=null and storeId !=\'\'\\\">\nand ss.`store_id` = #storeId#\n</if>\n<if test=\\\"startTime!=null \\\">\nAND pfd.`create_time` &gt;= #startTime#\n</if>\n<if test=\\\"endTime !=null \\\">\nAND pfd.`create_time` &lt;= #endTime#\n</if>\n<if test=\\\"communityId !=null and communityId !=\'\' \\\">\nAND pfd.`community_id` = #communityId#\n</if>\n<if test=\\\"configId !=null and configId !=\'\'\\\">\nAND pf.`config_id` = #configId#\n</if>\n<if test=\\\"primeRate!=null and primeRate!=\'\'\\\">\nAND pfd.`prime_rate` = #primeRate#\n</if>\n<if test=\\\"userName!=null and userName!=\'\'\\\">\nAND uu.name= #userName#\n</if>)) rt\"\n}', '', '', '{\"PARAM\": {\"param1\": \"$.#payFees#Array\",\"param2\":\"$.##Object\",\"param3\":\n\"$.#payFeeSum#Array\"},\"TEMPLATE\": {}}', '', '2020-12-24 14:02:40', '0');
