INSERT INTO `sys_document` VALUES ('862020100495430001', '/pages/dev/sysDocumentManage', '<p>文档信息方便页面配置相应说明</p><p>标题页面名称，一般菜单名称，如 文档信息菜单 取名文档信息</p><p>文档编码，一般为浏览器地址栏URL #开始至参数之前，如http://localhost:3000/admin.html#/pages/dev/sysDocumentManage?a=1 则/pages/dev/sysDocumentManage</p><p>信息内容一般说明页面重要信息</p>', '2020-10-04 23:29:35', '0', '文档信息');
INSERT INTO `sys_document` VALUES ('862020101749200037', '/pages/property/feeConfigManage', '<p><span>费用类型:费用类型为费用大类，如物业费，装修费，表明为一个收费大类</span></p><p><span>收费项目:物业自定义收费名称，比如2020年烤火费</span></p><p><span>费用标识：分为周期费用和一次性费用，周期费是连续收费的费用比如物业费每年都会收取，所以物业建议用周期费；</span></p><p><span>一次性费用表示费用只收取一次比如押金，下次收费时还需要手工创建到房屋上。</span></p><p><span>付费类型：分为预付费和后付费，预付费表示费用提前收费 比如2020-01-01至2021-01-01物业费 预付费在2020-01-01</span></p><p><span>开始就需要收取，后付费表示之后收取则在2021-01-01后才要收取</span></p><p><span>出账类型：出账类型只是表示欠费催收功能，每月1日表示每月1日推送业主微信进行催收。</span></p><p><span>计费起始时间：表示这条费用项开始时间，只是表示这个费用项开始时间和房屋上费用开始时间没有关系</span></p><p><span>计费结束时间：表示这条费用项结束时间，</span>只是表示这个费用项结束时间和房屋上费用结束时间没有关系</p><p><span>计算公式：分为面积*单价+附加费 、固定费、动态费、（本期费用-上次费用）*单价+附加费和用量* 单价+附加费</span></p><p>a、面积*单价+附加费 一般和房屋面积相关的费用采用该公式 如物业费</p><p>b、固定费 一般收费比较固定的费用 如果装修押金 停车费等</p><p>c、动态费 一般前台无需创建，一般程序使用，在费用导入时 导入的费用则为动态费类型</p><p>d、（本期费用-上次费用）*单价+附加费 一般为水电抄表类采用该费用项</p><p>e、用量* 单价+附加费 一般为代收费用 如 水电临时缴费，施工人员进场费等</p><p>计费单价： 公式中单价</p><p>附加费用：公式中的附加费 或者固定费<br></p><p><br></p>', '2020-10-17 11:22:52', '0', '费用项设置');
INSERT INTO `sys_document` VALUES ('862020122505583304', '/pages/common/enterCommunity', '<p>显示当前物业公司已经入驻成功的小区，物业公司也可以点击入驻小区按钮入驻新的小区。</p><p>当物业公司需要有新的小区加入平台管理时操作步骤：</p><p>1、需要联系运营人员在admin账户添加小区信息，并且审核</p><p>2、物业人员则在入驻小区弹框中就可以入驻小区</p><p>3、运营人员审核通过后，物业方可在该小区中正常使用</p><p>此页面比较重要字段解释</p><p>面积：此面积建议写小区内所有楼栋面积，这个值用来小区内按照小区面积公摊用，如果小区没有按面积公摊费用可以随便写此值</p><p>状态：入驻审核为 运营人员正在审核 需要联系运营人员审核 入驻成功为 物业公司已经入驻该小区可以正常使用，入驻失败为物业公司入驻失败不能使用该小区资源<br></p>', '2020-12-25 10:34:41', '0', '我的小区');
INSERT INTO `sys_document` VALUES ('862020122520224274', '/pages/property/unit', '<p>此页面可以查看单元相关信息，添加修改删除单元 可以再此页面 操作</p><p>但是我们不推荐这样做，工作量较大，推荐异步至系统管理资产导入导出</p><p>页面根据Excel模板整理数据直接导入系统。</p><p>重要字段说明：</p><p>建筑面积 此字段为该单元建筑面积，根据实际情况填写，主要用途为费用管理公摊公式时使用 根据单元面积公摊相应的电费水费等</p><p>注：当此系统使用在园区或者公寓时往往没有单元的概念 ，此时可能层的概念比较重，所以 再园区时单元可以转为层来使用也可以。<br></p>', '2020-12-25 10:54:09', '0', '单元信息');
INSERT INTO `sys_document` VALUES ('862020122533873439', '/pages/property/staffAppAuthManage', '<p>主要作用为例如缴费通知，维修单派单等通知需要通知物业人员，</p><p>所以需要在该页面点击认证按钮 扫一扫二维码认证自己的手机微信，</p><p>当系统有通知时会通知认证微信上，及时获取信息<br></p>', '2020-12-25 10:37:13', '0', '员工认证');
INSERT INTO `sys_document` VALUES ('862020122542254547', '/pages/property/room', '<p>此页面可以查看房屋相关信息，添加修改删除房屋 可以再此页面 操作</p><p>但是我们不推荐这样做，工作量较大，推荐移步至系统管理资产导入导出</p><p>页面根据Excel模板整理数据直接导入系统。</p><p>重要字段说明：</p><p>建筑面积 此字段为该房屋建筑面积，比较重要，房屋物业费等费用都是按此值来计算 务必填写正确。<br></p><p>算费系数 主要用来费用管理下的公摊公式使用，比较常见的电梯费公摊按每层每户收取不一样 可以用系数来控制。</p><p>房屋状态 分为：未销售，未入住，已交房，已装修，已入住 等状态</p><p>1、未销售表示 房屋和业主之间还没有任何关系，所以修改时状态不能手工修改 需要业主入住房屋的方式 将未销售改为已入住</p><p>2、未入住 已交房 已装修 已入住 状态表示业主和房屋之间已经有关系 可以相互修改，主要作用为在房屋创建费用时根据</p><p>不同的状态去创建不同的费用<br></p>', '2020-12-25 11:01:38', '0', '房屋管理');
INSERT INTO `sys_document` VALUES ('862020122557084197', '/pages/property/listFloor', '<p>此页面可以查看楼栋相关信息，添加修改删除楼栋 可以再此页面 操作</p><p>但是我们不推荐这样做，工作量较大，推荐异步至系统管理资产导入导出</p><p>页面根据Excel模板整理数据直接导入系统。</p><p>重要字段说明：</p><p>建筑面积 此字段为该栋楼建筑面积，根据实际情况填写，主要用途为费用管理公摊公式时使用 根据楼栋面积公摊相应的电费水费等<br></p>', '2020-12-25 10:50:39', '0', '楼栋信息');
INSERT INTO `sys_document` VALUES ('862020122564253773', '/pages/property/simplifyAcceptance', '<p>此页面为简化物业人员在平时使用系统，包括了以下内容：</p><p>1、业主房屋信息，业主可以根据业主信息 房屋信息 车辆信息 或者成员信息来查询关联的内容</p><p>2、房屋费用，可以做缴费 创建费用 缴费历史查看等功能</p><p>3、停车费，</p><p>4、业主所属家庭成员</p><p>5、业主车辆信息</p><p>6、报修单</p><p>7、投诉单</p><p>8、人脸门禁同步记录，这个需要和物联网系统配合使用，将业主上传的人脸同步至门禁设备，业主可以正常出入</p><p>9、道闸同步，将再物业系统添加的车辆缴费信息 同步至物联网系统</p><p>10、收据补打功能<br></p>', '2020-12-25 10:42:32', '0', '业务受理');
INSERT INTO `sys_document` VALUES ('8620210101050216618', '/pages/property/roomCreateFee', '<p>此页面可以给房屋批量创建费用</p><p>创建费用字段解释：</p><p>收费范围：小区、楼栋、单元、房屋</p><p>a、小区表示给小区里的所有房屋创建费用</p><p>b、楼栋表示 给小区里的指定楼栋中的房屋创建费用</p><p>c、单元给小区里指定单元中的房屋创建费用</p><p>d、给指定房屋创建费用</p><p>费用类型：如物业费、停车费等收费大类</p><p>收费项目：显示费用类型下收费项目，这个是您在费用项设置的收费项目（此时只显示当前时间有效的收费项目）</p><p>房屋状态：可以单选或多选方式创建费用</p><p>计费起始时间：表示 创建到房屋费用 从什么时候开始计费，如果每个房屋的时间不一致，建议 创建后每个房屋变更费用来修改每个房屋的计费起始时间</p><p><br></p><p>界面操作按钮解释：</p><p>欠费缴费：可以直接欠费缴费方式的房屋批量缴费</p><p>人工托收：当一些费用业主一直不交时可以人工托收到托收表，导出excel后委托第三方法律手段催收</p><p>查看费用：查看该房屋所有费用，包含结束的费用和正在收的费用</p>', '2021-01-01 13:17:06', '0', '房屋收费');
INSERT INTO `sys_document` VALUES ('8620210101062817828', '/pages/property/listCarFee', '<p>列表字段解释：</p><p>费用项目：车辆上创建的费用；</p><p>费用标识：分为一次性费用和周期费用</p><p>费用类型：费用大类 如物业费停车费等</p><p>应收金额：表示房屋欠费金额，所欠时间段为计费起始时间至计费结束时间，应收金额为0表示没有欠费</p><p>建账时间：表示此费用创建时间；</p><p>计费起始时间：表示该房屋此费用从这个时间开始计费，交一次费用，计费起始时间就会变动</p><p>计费结束时间：当前费用计费结束时间是根据费用项缴费周期和建账时间来确定，比如物业费用建账时间2020-11-1 当前时间2020-12-06 缴费周期6个月则计费结束时间为2021-5-1，如果当前时间为2021-6-6 则计费结束时间为2021-11-1&nbsp;计费结束时间 “-” 表示未到计费时间 或 收费已结束</p><p>状态：收费中和收费结束 收费中标识 费用还在继续收费，收费技术费用已经收费技术</p><p><br></p><p>操作按钮解释：</p><p>缴费：点击此按钮可以线下缴费</p><p>缴费历史：查看此费用缴费历史</p><p>取消费用：当费用创建错误时 可以点击取消费用，一般慎用</p><p>费用变更：创建费用时，可能计费起始时间和建账时间不正确，需要变更调整</p><p>水电抄表：可以手工抄入水电度数 收费</p><p>创建费用：可以车辆单独创建费用，可以批量常见费用的 收费范围为车辆是一直的</p>', '2021-01-01 15:23:39', '0', '停车费用');
INSERT INTO `sys_document` VALUES ('8620210101152316917', '/pages/property/listRoomFee', '<p>列表字段解释：</p><p>费用项目：房屋上创建的费用；</p><p>费用标识：分为一次性费用和周期费用</p><p>费用类型：费用大类 如物业费停车费等</p><p>应收金额：表示房屋欠费金额，所欠时间段为计费起始时间至计费结束时间，应收金额为0表示没有欠费</p><p>建账时间：表示此费用创建时间；</p><p>计费起始时间：表示该房屋此费用从这个时间开始计费，交一次费用，计费起始时间就会变动</p><p>计费结束时间：当前费用计费结束时间是根据费用项缴费周期和建账时间来确定，比如物业费用建账时间2020-11-1 当前时间2020-12-06 缴费周期6个月则计费结束时间为2021-5-1，如果当前时间为2021-6-6 则计费结束时间为2021-11-1&nbsp;<span>计费结束时间 “-” 表示未到计费时间 或 收费已结束</span></p><p>状态：收费中和收费结束 收费中标识 费用还在继续收费，收费技术费用已经收费技术</p><p><br></p><p>操作按钮解释：</p><p>缴费：点击此按钮可以线下缴费</p><p>缴费历史：查看此费用缴费历史</p><p>取消费用：当费用创建错误时 可以点击取消费用，一般慎用</p><p>费用变更：创建费用时，可能计费起始时间和建账时间不正确，需要变更调整</p><p>代收费用：指水电代收 施工人员进场费用收取，还可以灵活收费，将收费项目的单价设置为1后，这里可以输入自定义金额即可</p><p>水电抄表：可以手工抄入水电度数 收费</p><p>创建费用：可以房屋单独创建费用，可以批量常见费用的 收费范围为房屋是一直的</p><p>欠费缴费：显示应收金额不为0 的费用 可以一键缴费</p><p><br></p><p><br></p>', '2021-01-01 14:00:08', '0', '房屋费用');
INSERT INTO `sys_document` VALUES ('8620210101192317775', '/pages/property/carCreateFee', '<p>此页面可以给车辆批量创建费用</p><p>创建费用字段解释：</p><p>收费范围：小区、停车场</p><p>a、小区表示给小区里的所有车辆创建费用</p><p>b、停车场给指定的停车场的车辆创建费用</p><p>费用类型：如物业费、停车费等收费大类</p><p>收费项目：显示费用类型下收费项目，这个是您在费用项设置的收费项目（此时只显示当前时间有效的收费项目）</p><p>车位状态：可以单选或多选方式创建费用</p><p>计费起始时间：表示 创建到车辆费用 从什么时候开始计费，如果每个房屋的时间不一致，建议 创建后每个车辆变更费用来修改每个车辆的计费起始时间</p><p><br></p><p>界面操作按钮解释：</p><p>查看费用：查看该房屋所有费用，包含结束的费用和正在收的费用</p>', '2021-01-01 15:18:46', '0', '车辆收费');
INSERT INTO `sys_document` VALUES ('8620210101296118242', '/pages/property/returnPayFeeManage', '<p>当费用交错等情况需要 退费处理，此时可以去费用历史页面发起退费申请，退费审核页面需要相应领导审核退费</p>', '2021-01-01 15:47:14', '0', '退费审核');
INSERT INTO `sys_document` VALUES ('8620210101299018102', '/pages/property/roomFeeImport', '<p>费用导入填写说明：</p><p>费用类型：需要选择费用大类，导入费用时哪个费用大类</p><p>费用对象：需要选择是房屋费用导入还是车辆费用导入</p><p>下载模板：选择好费用类型和费用对象后可以下载模板根据费用对象生成相应小区内房屋或者车辆的列表excel</p><p>选择文件：在模板中填写费用名称、开始时间、结束时间和金额 直接导入即可</p><p>导入的明细可以在详情中查看</p><p>费用公摊说明：</p><p>公摊首先在公摊公式页面设置公摊公式，具体设置去此页面查看文档</p><p>费用名称：填写此次公摊名称 比如 2020年1月至3月公摊水费</p><p>费用类型：需要选择费用大类，一般选择公摊费</p><p>使用量：此次时间段 电费或者水费的总使用量</p><p>公摊范围：小区、楼栋、单元&nbsp;</p><p>房屋状态：需要公摊的房屋状态，如果全部状态都要公摊 则全选</p><p>公摊公式：根据公摊公式公摊</p><p>开始时间：此次公摊的开始时间</p><p>结束时间：此次公摊的结束时间</p><p><br></p><p>注意：导入和公摊费用都是生成一次性费用绑定到房屋或者车位上，费用项会默认建一条导入费用，公式为动态费用</p>', '2021-01-01 15:41:02', '0', '费用导入');
INSERT INTO `sys_document` VALUES ('8620210101385217892', '/pages/property/billManage', '<p>配置：</p><p>a、需要在费用项设置催收方式按年 按月 按日催收</p><p>b、配置公众号，在系统管理下公众号配置，添加公众号，在微信公众号中申请欠费推送模板消息，并将模板ID填写在物业系统公众号页面的欠费推送模板ID中，就可以实现欠费推送业主微信。</p><p>说明：</p><p>账单推送是按费用推送，每个费用推送房屋可以查看欠费清单</p><p><br></p>', '2021-01-01 15:28:44', '0', '账单催缴');
INSERT INTO `sys_document` VALUES ('8620210101445618138', '/pages/property/staffFeeManage', '<p>根据开始时间和结束时间查询 这段时间中各个员工收收的费用金额，用于对账用</p>', '2021-01-01 15:44:36', '0', '员工收费');
INSERT INTO `sys_document` VALUES ('8620210101920916241', '/pages/property/listOwnerMember', '<p>请先选择业主 然后再添加业主下的成员</p><div class=\"modal-body\"><p>名称：表示成员名称</p><p>身份证：是成员身份可选字段，不强制要求录入</p><p>联系方式：表示成员手机号，请填写正确的手机号，业主端手机版绑定业主是根据业主名称 联系方式来认证；</p><p>成员图片：在新增和修改时上传图片或者拍照时 成员头像会推送至门禁设备，就可以开门，如果没有对接门禁设备</p><p>可以不用录入</p><p>动态字段：如果在使用时如果字段不够用可以在开发这账户 属性下动态添加字段 比如微信 QQ字段就是通过这种方式添加的</p><p>类型：家庭成员，租客和其他，这里注意 如果业主在一个小区有多套房屋，并且一套房子出租一条自用时 防止租客进入另一个</p><p>单元建议采用不通的业主来避免</p></div>', '2021-01-01 13:01:57', '0', '业主成员');
INSERT INTO `sys_document` VALUES ('8620210101953516259', '/pages/property/auditAppUserBindingOwnerManage', '<p>此页面可以查看业主手机端业主绑定的记录，物业也可以解绑来禁止业主登录</p>', '2021-01-01 13:04:36', '0', '绑定业主');
INSERT INTO `sys_document` VALUES ('8620210101988516160', '/pages/property/listOwner', '<p>业主名称：表示业主名称，如果一套房屋有多个业主可以选择一个人作为业主</p><p>身份证：是业主身份可选字段，不强制要求录入</p><p>联系方式：表示业主手机号，请填写正确的手机号，业主端手机版绑定业主是根据业主名称 联系方式来认证；</p><p>业主图片：在新增和修改时上传图片或者拍照时 业主头像会推送至门禁设备，就可以开门，如果没有对接门禁设备</p><p>可以不用录入</p><p>入住房屋：此按钮在变更按钮下，业主和房屋直接绑定关系，但是一般不推荐这么操作工作量太大建议你在系统管理资产导入导出页面</p><p>直接导入业主和房屋关系</p><p>房屋解绑：此按钮在变更按钮下，解除业主和房屋关系</p><p>动态字段：如果在使用时如果字段不够用可以在开发这账户 属性下动态添加字段 比如微信 QQ字段就是通过这种方式添加的</p>', '2021-01-01 12:57:58', '0', '业主信息文档');
INSERT INTO `sys_document` VALUES ('8620210101996718411', '/pages/property/meterWaterManage', '<p>水电抄表两种方式操作：</p><p>一种 当个房屋抄表，点击抄表选择楼栋、单元、房屋、本期度数、本期读表时间保存即可</p><p>二钟 excel批量抄表，点击抄表导入，选择费用类型 收费项目 下载导入模板 填写抄表数据 选择文件导入即可</p>', '2021-01-01 15:54:12', '0', '水电抄表');
INSERT INTO `sys_document` VALUES ('862021010824422746', '/pages/property/workflowSettingManage', '<p>说明：</p><p>流程设置是指审批等需要设置流程，比如第一步处理人 第二步处理人等</p><p>重要字段解释：</p><p>流程步骤中的普通流程 指串行的审核流程，比如投诉建议 张三提交后李四审核处理，李四审核后王五审核处理最后张三确认；</p><p>流程步骤中的会签流程 指并行审核流程，比如投诉建议 张三提交后 投诉单同时到李四和王五的工位只有两个人都审核同意后才会到下一个吴六的工位，只要李四和王五中一个人审核不通过，则投诉单会退到张三工位；</p><p>流程步骤中的采购人员 是采购流程特有的，是指定采购人员，该人员可以打印采购单去采购物品并且入库；</p><p>流程步骤中的普通人员 是采购流程特有的，是指定采购申请普通的审核人员；</p><p>流程步骤中的采购人员 是物品领用流程特有的，是指定仓库管理员保管物品的人员；</p><p>流程步骤中的普通人员 是物品领用流程特有的，是指定出库申请普通的审核人员；</p><p>按钮说明：</p><p>添加步骤按钮是指通过该功能可以添加新的流程处理人员</p><p>删除步骤按钮是指通过该功能可以删除已有的流程处理人员</p><p>添加员工按钮是指 在会签时可以添加同时处理流程的人员</p><p><br></p>', '2021-01-08 08:50:21', '0', '流程设置');
INSERT INTO `sys_document` VALUES ('862021010885435449', '/pages/property/publicWeChatManage', '<p>公众号配置说明：</p><p>名称：可以自定义没有太多要求；</p><p>appId: 为微信公众号对应appId,在微信公众号后台 开发菜单下的基本配置页面获取；</p><p>应用秘钥：为微信公众号对应<span style=\"color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">开发者密码</span><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">(AppSecret)</span>,在微信公众号后台 开发菜单下的基本配置页面获取；</p><p>支付密码：为微信商户后台中的api支付秘钥</p><p>商户ID：为微信商户ID</p><p>注意：如果在公众号上交物业费需要调起支付时需要准确配置支付密码和商户ID，否则可以随便填写即可</p><p>公众号信息配置说明：</p><p>服务器地址（URL）为系统自动生成地址不需修改，直接复制然后粘贴到微信公众号后台开发菜单下的基本配置页面下的&nbsp;<span style=\"color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">服务器地址</span><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">(URL)</span></p><p><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">令牌（Token）请修改以免被别人猜到，修改完后将值复制</span>然后粘贴到微信公众号后台开发菜单下的基本配置页面下的&nbsp;<span style=\"color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">令牌</span><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">(Token)，然后微信公众号后台点击保存，启用配置</span></p><p><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">欠费推送模板ID：需要在微信公众号后台功能下的模板消息页面中申请欠费推送模板 然后将模板ID填写，此处流程为系统根据费用项中配置的出账类型 定期去跑后台数据 然后将此费用项下跑出来的欠费用户推送欠费消息到业主微信上（前提情况是业主必须登录过我们的公众号）</span></p><p><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">业主缴费成功通知：同样需要申请消息模板，该模板可以通知业主也可以通知物业领导，流程为在物业web端缴费或者在业主手机端缴费 都会触发通知，业主端则直接通知到业主微信，物业端首先需要物业人员在组织管理下的员工认证页面认证自己的微信，然后给相应权限即可（权限在组织管理下员工认证下的微信缴费通知）</span></p><p><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">物业管理通知：同样需要申请消息模板，主要作用为在智慧服务下发布公告页面中发布时选择公告类型为业主微信时，则会用改模板推送至业主微信上，用来方便物业做通知之类的</span></p><p><span class=\"tips\" style=\"margin: 0px; padding: 0px; color: rgb(53, 53, 53); font-family: mp-quote, -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 14px;\">业主费用到期通知：业主费用快要到期（7天内到期）时，系统会将提醒缴费信息推送至业主微信上<br></span></p>', '2021-01-08 10:27:48', '0', '公众号');
